import { 
  Box
} from '@material-ui/core';

import '../styling/remixComponent.css';


const RemixComponent = () => {  
  return(
    <Box
      id='remix-component'
    >
      number
      picture
       
      <Box
        id='remix-title-artist'
      >
        title 
        artist
      </Box>
    </Box>
    )
}

export default RemixComponent;
